
DROP TABLE IF EXISTS `gBrewlogStock`;
CREATE TABLE gBrewlogStock (entity int not null AUTO_INCREMENT ,brewlog char(255),recipe char(255),owner char(255),unit char(255),storecategory char(255),activityNum int ,stock char(255),qty float ,cost float ,subcategory char(255),costrefund int ,stocktag char(255), PRIMARY KEY(entity) );
